//App.js

import React from 'react';

function App(){
	return(
		<div>
			<nav>
				<ul>
					<li>1</li>
					<li>2</li>
					<li>3</li>
				</ul>
			</nav>
			<main>
				<p> Today </p>
			</main>
		</div>
	)
}

export default App
